import {MDBContainer} from "mdbreact";
import React from "react";
import {Radar} from "react-chartjs-2";

export type RadarChartProps={
  RadarChartData:any;
}

const RadarChartV=(props:RadarChartProps)=>{

    return (
      <MDBContainer style={{paddingTop:"40px"}}>

        <Radar  data={props?.RadarChartData} options={{ responsive: true }} height={props?.RadarChartData.height} />
      </MDBContainer>
    );
  }

export default RadarChartV;
